var tipuesearch = {"pages": [{'title': 'week', 'text': '', 'tags': '', 'url': 'week.html'}, {'title': 'week2-5', 'text': 'week2 \n 1.下載2019Fall可攜套件.7z並解壓縮 \n 2.建立個人的cad2019倉儲和網站 \n 3.影片網址:\xa0 https://youtu.be/FY6wF9zFf1g \n \n \n week3 \n solvespace編譯 \n 1.先將 Y:\\portablegit\\bin\\sh.exe 改名為 sh_rename_for_solvespace.exe \n 2.查驗 git 版本為git 2.13 版本以上, 可以使用下列 git clone\xa0 --recurse-submodules 取得所有子模組資料 \n 3.將713、714行的開頭加上# \n 4.手動進行 libpng.dll.a 的編譯, 並改名為 libpng_static.a, 並放到編譯系統的 lib 目錄中 \n 5.回到 solvespace 原始碼目錄, 建立 build 目錄後進入 build 目錄, 執行 \n 6.影片網址:  https://youtu.be/yQTFYy3cLI0 \n \n \n week4 \n 完成前3週的進度並上傳完成 \n week5 \n 1.利用 Solvespace 繪製零組件，錄製影片並講解繪圖過程 \n 2.影片網址:  https://youtu.be/KC2Xj1ussfo \n \n', 'tags': '', 'url': 'week2-5.html'}, {'title': 'week6-9', 'text': 'week6 \n 1.利用 Solvespace 繪製雙輪車並組裝，錄製繪圖過程並講解後上字幕，傳至YOUTUBE \n \xa0 \xa0 *標題為: 機械設計工程系-電腦輔助設計實習 W6 任務一參數化零組件繪製 \n 影片網址:  https://youtu.be/LG42yt45jJw \n \n 2.利用 V-rep 3.6.1 rev4 與隨身程式執行系統, 完成網際 V-rep 模型控制 \n \xa0 \xa0 *標題為: 機械設計工程系-電腦輔助設計實習 W6 任務一網際 V-rep 模型控制 \n 影片網址:\xa0 https://youtu.be/RpGeZjzcwPk \n \n 3.新增兩個按鈕, 可以啟動或停止連線的 V-rep 模擬 \n \xa0 \xa0 *標題為: 機械設計工程系-電腦輔助設計實習 W6 任務一新增啟動與停止按鈕 \n 影片網址:  https://youtu.be/chIQEruwN4E \n \n week7 \n 1.在Solvespace的 Help->About 中, 編譯成 "This Solvespace is compiled by 學號" \n \xa0 \xa0 影片網址:\xa0 https://youtu.be/OUkvSXTmYSE \n \n 後半段影片: https://youtu.be/DnkpkX6UMDs \n \n 2.從零件網頁中選擇並 利用Solvespace繪出 \n \xa0 \xa0影片網址:\xa0 https://youtu.be/JJyDbIbfgv8 \n \n week8 \n 1.連結網頁上的BLOG \n 2.影片網址:  https://youtu.be/s-EJDQ8yAA0 \n \n 3.下載並導入Webots \n 4.影片網址:\xa0 https://youtu.be/uWSnJwFYEZg \n \n', 'tags': '', 'url': 'week6-9.html'}, {'title': 'week10-14', 'text': 'week10 \n NX的發展歷史 \n \xa0\xa0 \n 1960年-McDonnell Douglas Automation公司成立。 \n 1976年-收購 Unigraphics CAD/CAE/CAM系統的開發商—United Computing公司，UG的雛形問世。 \n 1983年-UG 上市。 \n 1986年-Unigraphics吸取了業界領先的、為實踐所證實的實體建模核心——Parasolid的部份功能。 \n 1989年-Unigraphics宣布支持UNIX平台及開放系統的結構，並將一個新的與STEP標準兼容的Parasolid引入UG。 \n 1990年-Unigraphics作為McDonnell Douglas（波音飛機公司）的機械CAD/CAE/CAM的標準。 \n 1991年-Unigraphics開始了從CAD/CAE/CAM大型機版本到工作站版本的轉移。 \n 1993年-Unigraphics引入複合建模的概念，可以實體建模、曲線建模、框線建模、半參數化及參數化建模。 \n 1995年-Unigraphics"首次"發布了Windows NT版本。 \n 1996年-Unigraphics發布了能自動進行干涉檢查的功能模塊、最先進的CAM模塊以及具有A類曲線造型能力的工業造型模塊。 \n 1997年-Unigraphics新增了包括WAVE（幾何連結器）在內的一系列工業領先的新增功能。WAVE可以定義、控制、評估產品模板。 \n 2000年-Unigraphics發布了新版本的UG17，第一個可以裝載包含深層嵌入「基於工程知識」。 \n 2001年-Unigraphics發布了新版本UG18，新版本對對話框進行了調整，使得在最少的對話框中能完成更多的工作。 \n 2002年-Unigraphics發布了UG NX1.0.。新版本繼承了UG18的優點，改進和增加了許多功能。 \n 2003年-Unigraphics發布了新版本UG NX2.0 。新版本是最新的行業標準，用於支持完整的產品工程。 \n 2004年-Unigraphics發布了新版本的UG NX3.0，它為用戶的產品設計與加工過程提供了數字化造型和驗證手段。 \n 2005年-Unigraphics發布了新版本的UG NX4.0，使得開發與應用更加簡單和快捷。 \n 2007年04月-UGS公司發布了NX 5.0的下一代數字產品開發軟體，幫助用戶以更快的速度開發創新產品。 \n 2008年06月-Siemens PLM Software發布UG NX 6.0，建立在新的同步建模技術基礎之上。 \n 2009年10月-Siemens PLM Software 宣布推出其旗艦數字化產品開發解決方案NX軟體的最新版。UG NX 7.0引入了「HD3D」（三維精確描述）功能，新增了同步建模技術的增強功能。修復了很多6.0所存在的漏洞。 \n 2010年5月-Siemens PLM Software在上海發布UG NX 7.5，工具箱將作為一個應用模塊與NX 7一起同步發布。 \n 2011年09月-Siemens PLM Software發布了UG NX 8.0 \n 2012年10月-Siemens PLM Software發布了UG NX 8.5 \n 2013年10月-Siemens PLM Software發布了UG NX 9.0 \n 2014年8月-Siemens PLM Software發布了UG NX 10.0 \n 2016年8月-Siemens PLM Software發布了UG NX 11.0 \n 2017年10月-Siemens PLM Software發布了UG NX 12.0 \n week12 \n 1.閱讀並翻譯第4章，節錄終點放置分組網站\xa0 \n CH4 3D建模 4.1 功能 分別為圖元、參考特徵、掃描特徵、刪除特徵、選取特徵和自訂義。 4.1.1 圖元 可直接開啟以定義完成之實體，包括 : 方塊、圓柱、角錐和球。 4.1.2 參考特徵 可建立參考點、參考軸、參考平面或座標，方便後續工作。 4.1.3 掃描特徵 可用拉伸或旋轉截面來創建實體。包括 : 伸長長料、旋轉長料、掃略、管子和特殊掃略。 4.1.4刪除特徵 刪除多餘的部分。包括 : 孔、鑑座、插槽和凹槽。 4.1.5選取特徵 包括 : 薄殼、增厚、界線除料、選取、曲線。 *選取在Insert →Associative Copy中 *薄殼、增厚在Insert →Offset/Scale *曲線在Insert →Surface 4.1.6自訂義 可將常用工具新增在同一個列表。 \n 2.利用NX繪製零件 \n 3.影片連結:  https://youtu.be/Huljf6YStGs \n \n 4. Webots tutorial-1 操作 \n 5.影片連結: https://youtu.be/_KBhozpOt-8 \n \n Week13 \n 1.說明W10-W12進度 \n 2.影片連結: https://youtu.be/X3StmiyIETM \n \n', 'tags': '', 'url': 'week10-14.html'}, {'title': 'week15-18', 'text': '', 'tags': '', 'url': 'week15-18.html'}, {'title': 'note', 'text': '', 'tags': '', 'url': 'note.html'}, {'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules \xa0 https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數.', 'tags': '', 'url': 'Develop.html'}]};